normalStr = ""

def sendSingle(normalStr):
	reverseStr = ""
	i=0
	while i<len(normalStr):
		element = normalStr[i]
		if element == "A":
			reverseStr = "T" + reverseStr 
		elif element == "T":
			reverseStr = "A" + reverseStr 
		elif element == "G":
			reverseStr = "C" + reverseStr 
		elif element == "C":
			reverseStr = "G" + reverseStr
		i = i+1	 
	print (reverseStr)
	return

sendSingle(normalStr)